mapper.insert:
INSERT INTO tb_syslog_info(

     id
     ,log_action
     ,log_route
     ,log_ip
     ,log_mark
     ,creater_id
     ,created_at
     ,updated_at
     ,time_stamp

) VALUES (

     NULL
     ,#{logAction}
     ,#{logRoute}
     ,#{logIp}
     ,#{logMark}
     ,#{createrId}
     ,#{createdAt}
     ,#{updatedAt}
     ,#{timeStamp}

)

SELECT LAST_INSERT_ID() AS id

mapper.update:
UPDATE tb_syslog_info
log_action = #{logAction}, log_route = #{logRoute}, log_ip = #{logIp}, log_mark = #{logMark}, creater_id = #{createrId}, created_at = #{createdAt}, updated_at = #{updatedAt}, time_stamp = #{timeStamp}
WHERE id = #{id} LIMIT 1

